import React from 'react';
import StudentList from './StudentList';
import AddStudent from './AddStudent';

const StudentDashboard = () => {
    return (
        <div className="student-dashboard">
            <h1>Student Dashboard</h1>
            <AddStudent />
        </div>
    );
};

export default StudentDashboard;
